import './Footer.css';

import { Container,Row, Col, ListGroupItem } from 'reactstrap';
import { Link } from 'react-router-dom';
import logo from "../../assets/images/logo.png";

const quick__links=[
  {
    path:'/home',
    display:'Home'
  },
  {
    path:'#',
    display:'About'
  },
  {
    path:'/tours',
    display:'Tours'
  }
]

const quick__links2=[
  {
    path:'/gallery',
    display:'Gallery'
  },
  {
    path:'/login',
    display:'Login'
  },
  {
    path:'/register',
    display:'Register'
  }
]


const Footer = () => {
  return (
    <footer className='footer'>
      <Container>
        <Row>
          <Col lg="3">
            <div className="logo">
              <img src={logo} alt="" />
              <p>Lorem ipsum dolor sit amet consectetur, adipisicing elit. Ad at, natus nostrum neque pariatur nemo, voluptatum deserunt maxime eveniet debitis, quibusdam et? Laborum placeat eum provident distinctio, libero nulla neque?</p>
           
              <div className="social__links d-flex align-items-center gap-4">
                <span>
                  <Link to=''></Link>
                </span>
              </div>
            </div>
          </Col>
        </Row>
      </Container>
    </footer>
  )
}

export default Footer
